package gcfv2.datastore_api;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;import java.util.Date;@NoArgsConstructor@Getter@Setterpublic class Ticket {    private String ticketId;    private String subject;    private String description;    private Date creationDate;    private Date updateDate;    public Ticket(String subject, String description, Date creationDate, Date updateDate) {        this.subject = subject;        this.description = description;        this.creationDate = creationDate;        this.updateDate = updateDate;    }}